import React, {Component} from 'react';
import classes from "./MainWindow.module.css"
class MainWindow extends Component {
    render() {
        return (
            <div className={classes.MainWindow}>
                <header className={classes.Header}>
                    <img src={require("./images/HeaderLogo.jpg")} className={classes.Logo}  alt={"Картинка"}/>
                    <p>Pet Hotel</p>
                </header>
                <div className={classes.MainWindowContent}>
                    <img src={require("./images/MainWinCont.jpg")} className={classes.MainImg} alt={"Картинка"}/>
                    <div className={classes.MainWinText}>
                        Добро пожаловать в веб-приложение для поиска дома для вашего питомца
                    </div>
                </div>
                <footer className={classes.Footer}>
                    <div className={classes.FooterContent}>

                    </div>
                </footer>
            </div>
        );
    }
}

export default MainWindow;
